import React from 'react';
import { Link } from 'react-router-dom';
import imglogo from '../assets/logo-white.png';

const Logo = () => {
  return (
    <div>
      <Link to="/">
        <div
          className="
             rounded-xl flex items-center justify-center
                       
          "
        >
          <img
            src={imglogo}
            alt="Logo"
            className="
              w-10 h-10
                 /* clarity white glow */
                 /* neon purple glow */
            "
          />
        </div>
      </Link>
    </div>
  );
};

export default Logo;


